import React, { Component } from 'react';
import CarMake from './CarMake'

class CarMakesList extends Component {

  render() {
    const { makes, nextStep } = this.props
    return (
      <div>
        List of Manufacturers
        <ul>
        {
          makes.map((make, id) => {
            return <CarMake key={id} make={make} nextStep={nextStep}/>
          })
        }
        </ul>
      </div>
    );
  }

}

export default CarMakesList;
